#[no_mangle]
#[signature(c)]
pub extern "C" fn turso_sync_operation_resume(
    operation: c::turso_sync_operation_t,
) -> c::turso_sync_operation_resume_result_t {
    let operation = match unsafe { TursoDatabaseAsyncOperation::ref_from_capi(operation) } {
        Ok(operation) => operation,
        Err(err) => {
            return c::turso_sync_operation_resume_result_t {
                status: err.to_capi(),
                ..Default::default()
            }
        }
    };
    let result = match operation.resume() {
        Ok(result) => result,
        Err(err) => {
            return c::turso_sync_operation_resume_result_t {
                status: err.to_capi(),
                ..Default::default()
            };
        }
    };
    let result = result.to_capi();
    c::turso_sync_operation_resume_result_t {
        status: result.status,
        result: result.result,
    }
}

