#[no_mangle]
#[signature(c)]
pub extern "C" fn turso_sync_database_io_poison(
    request: c::turso_sync_io_item_t,
    error: turso_slice_ref_t,
) -> turso_status_t {
    let request = match unsafe { SyncEngineIoQueueItem::<Vec<u8>>::ref_from_capi(request) } {
        Ok(request) => request,
        Err(err) => return err.to_capi(),
    };
    let error = match str_from_turso_slice(error) {
        Ok(error) => error.to_string(),
        Err(err) => return err.to_capi(),
    };
    request.get_completion().poison(error);
    turso_status_ok()
}

